<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Слепая зона — Карта московских маньяков</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      background: #0A0A0A;
      color: #F5F5F5;
      font-family: 'SF Pro Display', -apple-system, BlinkMacSystemFont, sans-serif;
      overflow: hidden;
      height: 100vh;
    }

    /* Шумовая текстура */
    body::before {
      content: '';
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-image: url("data:image/svg+xml,%3Csvg viewBox='0 0 256 256' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='noise'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.9' numOctaves='4' stitchTiles='stitch'/%3E%3C/filter%3E%3Crect width='100%25' height='100%25' filter='url(%23noise)'/%3E%3C/svg%3E");
      opacity: 0.03;
      pointer-events: none;
      z-index: 1000;
    }

    .container {
      display: flex;
      flex-direction: column;
      height: 100vh;
    }

    header {
      padding: 20px 40px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      border-bottom: 1px solid #1a1a1a;
    }

    .logo {
      font-size: 14px;
      font-weight: 600;
      letter-spacing: 0.1em;
      text-transform: uppercase;
    }

    .stats {
      font-size: 12px;
      color: #666;
    }

    .stats span {
      color: #DC2626;
    }

    .map-container {
      flex: 1;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 20px;
      position: relative;
    }

    #map {
      max-width: 100%;
      max-height: 100%;
      cursor: grab;
    }

    #map:active {
      cursor: grabbing;
    }

    /* Маркеры */
    .marker {
      fill: #DC2626;
      cursor: pointer;
      transition: all 0.2s ease;
    }

    .marker:hover {
      fill: #EF4444;
      filter: drop-shadow(0 0 8px rgba(220, 38, 38, 0.6));
    }

    /* Подписи имён маньяков */
    .marker-label {
      font-family: 'SF Pro Display', -apple-system, BlinkMacSystemFont, sans-serif;
      font-weight: 600;
      pointer-events: auto;
      cursor: pointer;
      fill: #DC2626;
      stroke: #0A0A0A;
      stroke-width: 2.5px;
      stroke-linejoin: round;
      paint-order: stroke fill;
    }

    /* Подписи районов */
    .district-label {
      font-family: 'SF Pro Display', -apple-system, BlinkMacSystemFont, sans-serif;
      font-size: 5px;
      font-weight: 400;
      pointer-events: none;
      fill: rgba(255, 255, 255, 0.15);
      text-anchor: middle;
    }

    /* Карточка */
    .card {
      position: fixed;
      background: rgba(15, 15, 15, 0.95);
      border: 1px solid #222;
      border-top: 2px solid #DC2626;
      width: 280px;
      max-height: 85vh;
      overflow-y: auto;
      opacity: 0;
      visibility: hidden;
      transition: opacity 0.2s ease, visibility 0.2s ease;
      z-index: 100;
      backdrop-filter: blur(10px);
    }

    .card.visible {
      opacity: 1;
      visibility: visible;
    }

    .card-photo {
      width: 100%;
      height: 240px;
      object-fit: cover;
      object-position: center 20%;
      display: block;
      filter: grayscale(100%);
    }

    .card-photo.hidden {
      display: none;
    }

    .card-body {
      padding: 16px 20px 20px;
    }

    .card-address {
      font-size: 11px;
      color: #666;
      text-transform: uppercase;
      letter-spacing: 0.05em;
      margin-bottom: 8px;
    }

    .card-name {
      font-size: 18px;
      font-weight: 600;
      margin-bottom: 4px;
    }

    .card-nickname {
      font-size: 13px;
      color: #DC2626;
      margin-bottom: 12px;
    }

    .card-meta {
      font-size: 12px;
      color: #888;
      margin-bottom: 12px;
    }

    .card-victims {
      color: #DC2626;
      font-weight: 700;
      font-size: 14px;
    }

    .card-description {
      font-size: 13px;
      line-height: 1.5;
      color: #aaa;
    }

    .card-sentence {
      font-size: 11px;
      font-weight: 600;
      text-transform: uppercase;
      letter-spacing: 0.05em;
      color: #DC2626;
      margin-top: 10px;
      padding-top: 8px;
      border-top: 1px solid #222;
    }

    footer {
      padding: 15px 40px;
      border-top: 1px solid #1a1a1a;
      display: flex;
      justify-content: space-between;
      align-items: center;
      font-size: 12px;
      color: #666;
    }

    .controls {
      display: flex;
      gap: 10px;
    }

    .controls button {
      background: #1a1a1a;
      border: 1px solid #333;
      color: #888;
      width: 44px;
      height: 44px;
      cursor: pointer;
      font-size: 20px;
      transition: all 0.2s;
      -webkit-tap-highlight-color: transparent;
      touch-action: manipulation;
    }

    .controls button:hover,
    .controls button:active {
      background: #222;
      color: #fff;
    }

    .legend {
      display: flex;
      align-items: center;
      gap: 8px;
      font-size: 12px;
      color: #555;
    }

    .legend-dot {
      display: inline-block;
      width: 8px;
      height: 8px;
      border-radius: 50%;
      background: #DC2626;
      margin-right: 4px;
      vertical-align: middle;
    }

    .legend-divider {
      color: #333;
    }

    /* Мобильная адаптация */
    @media (max-width: 768px) {
      header {
        padding: 15px 20px;
        flex-direction: column;
        gap: 8px;
      }

      .logo {
        font-size: 12px;
      }

      .stats {
        font-size: 11px;
      }

      footer {
        padding: 10px 20px;
      }

      .controls button {
        width: 48px;
        height: 48px;
        font-size: 24px;
      }

      .card {
        width: 260px;
        max-width: 80vw;
        max-height: 80vh;
      }

      .card-photo {
        height: 120px;
      }

      .card-body {
        padding: 12px 15px 15px;
      }

      .marker {
        cursor: pointer;
      }
    }
  </style>
</head>

      </div>
    </header>

        nickname: "Буратино",
        years: "2002",
        victims: 4,
        address: "Ярославское шоссе, Бабушкинский",
        district: "Бабушкинский",
        coords: [37.66, 55.86],
        description: "Криминальный элемент. За 8 дней убил 4 человек ради денег. Разоблачён только через 20 лет по ДНК. Ошибка ИИ при распознавании лиц привела к аресту невиновного учёного.",
        sentence: "13 лет (срок давности по части эпизодов)",
        photo: "https://upload.wikimedia.org/wikipedia/ru/b/b4/Andrew_Aleshin_serial_killer.jpg"
      }
    ];

    // Загружаем SVG
    function loadMap() {
      const svg = document.querySelector('#map svg');

      // Подписи районов
      addDistrictLabels(svg);

      // Добавляем маркеры
      addMarkers(svg);

      // Инициализируем pan/zoom
      const pz = panzoom(svg, {
        maxZoom: 5,
        minZoom: 0.5,
        initialZoom: 1,
        bounds: true,
        boundsPadding: 0.1
      });

      // Кнопки зума
      document.getElementById('zoom-in').addEventListener('click', () => pz.zoomIn());
      document.getElementById('zoom-out').addEventListener('click', () => pz.zoomOut());
    }

    function addDistrictLabels(svg) {
      const districtsGroup = svg.querySelector('#districts');
      if (!districtsGroup) return;

      // Создаём группу для подписей районов (под маркерами)
      const labelsGroup = document.createElementNS('http://www.w3.org/2000/svg', 'g');
      labelsGroup.setAttribute('id', 'district-labels');

      const seen = new Set();

      districtsGroup.querySelectorAll('path[data-name]').forEach(path => {
        const name = path.getAttribute('data-name');
        if (!name || seen.has(name)) return;
        seen.add(name);

        // Вычисляем центр через getBBox
        const bbox = path.getBBox();
        const area = bbox.width * bbox.height;

        // Показываем только районы с достаточной площадью
        if (area < 800) return;

        const cx = bbox.x + bbox.width / 2;
        const cy = bbox.y + bbox.height / 2;

        const label = document.createElementNS('http://www.w3.org/2000/svg', 'text');
        label.setAttribute('x', cx);
        label.setAttribute('y', cy);
        label.setAttribute('class', 'district-label');
        label.textContent = name;

        labelsGroup.appendChild(label);
      });

      // Вставляем подписи районов перед маркерами
      const markersGroup = svg.querySelector('#markers');
      svg.insertBefore(labelsGroup, markersGroup);
    }

    function addMarkers(svg) {
      const markersGroup = svg.querySelector('#markers');
      const viewBox = svg.viewBox.baseVal;

      // Границы карты (из данных)
      const bounds = {
        minLon: 36.8031,
        maxLon: 37.9708,
        minLat: 55.1422,
        maxLat: 56.0212
      };

      maniacs.forEach(m => {
        const x = ((m.coords[0] - bounds.minLon) / (bounds.maxLon - bounds.minLon)) * viewBox.width;
        const y = ((bounds.maxLat - m.coords[1]) / (bounds.maxLat - bounds.minLat)) * viewBox.height;

        // Размер точки зависит от количества жертв
        const victims = typeof m.victims === 'number' ? m.victims : 10;
        const radius = Math.max(4, Math.min(12, 3 + victims / 5));

        const circle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
        circle.setAttribute('cx', x);
        circle.setAttribute('cy', y);
        circle.setAttribute('r', radius);
        circle.setAttribute('class', 'marker');
        circle.setAttribute('data-id', m.id);

        // События — десктоп
        circle.addEventListener('mouseenter', (e) => showCard(m, e));
        circle.addEventListener('mouseleave', hideCard);

        // События — мобильные (тап)
        circle.addEventListener('click', (e) => {
          e.stopPropagation();
          showCard(m, e);
        });
        circle.addEventListener('touchstart', (e) => {
          e.stopPropagation();
        }, { passive: true });

        markersGroup.appendChild(circle);

        // Подпись с именем — размер пропорционален точке
        const fontSize = Math.max(6, Math.min(14, radius * 1.2));
        const estimatedTextWidth = m.name.length * fontSize * 0.6;
        const svgWidth = 1200;
        const overflowsRight = (x + radius + 3 + estimatedTextWidth) > svgWidth;
        const labelX = overflowsRight ? x - radius - 3 : x + radius + 3;
        const labelY = y + fontSize / 3;

        const label = document.createElementNS('http://www.w3.org/2000/svg', 'text');
        label.setAttribute('x', labelX);
        label.setAttribute('y', labelY);
        label.setAttribute('class', 'marker-label');
        label.setAttribute('font-size', fontSize + 'px');
        if (overflowsRight) {
          label.setAttribute('text-anchor', 'end');
        }
        label.textContent = m.name;

        // Hover/click на подпись — показывает карточку
        label.addEventListener('mouseenter', (e) => showCard(m, e));
        label.addEventListener('mouseleave', hideCard);
        label.addEventListener('click', (e) => {
          e.stopPropagation();
          showCard(m, e);
        });

        markersGroup.appendChild(label);
      });
    }

    function showCard(maniac, event) {
      const card = document.getElementById('card');

      document.getElementById('card-address').textContent = maniac.address;
      document.getElementById('card-name').textContent = maniac.name;
      document.getElementById('card-nickname').textContent = maniac.nickname ? `«${maniac.nickname}»` : '';
      document.getElementById('card-meta').innerHTML = `${maniac.years} · <span class="card-victims">${maniac.victims} жертв</span>`;
      document.getElementById('card-description').textContent = maniac.description;
      document.getElementById('card-sentence').textContent = maniac.sentence || '';

      const photo = document.getElementById('card-photo');
      if (maniac.photo) {
        photo.src = maniac.photo;
        photo.style.objectPosition = maniac.photoPosition || 'center 20%';
        photo.classList.remove('hidden');
      } else {
        photo.classList.add('hidden');
        photo.src = '';
      }

      // Позиционирование
      const rect = event.target.getBoundingClientRect();
      let left = rect.right + 15;
      let top = rect.top - 20;

      // Если не помещается справа — слева
      if (left + 280 > window.innerWidth) {
        left = rect.left - 295;
      }

      card.style.left = Math.max(10, left) + 'px';
      card.style.top = '10px';
      card.classList.add('visible');

      // После рендера — корректируем позицию по реальной высоте
      requestAnimationFrame(() => {
        const cardH = card.offsetHeight;
        const winH = window.innerHeight;
        if (top + cardH > winH - 10) {
          top = Math.max(10, winH - cardH - 10);
        }
        top = Math.max(10, top);
        card.style.top = top + 'px';
      });
    }

    function hideCard() {
      document.getElementById('card').classList.remove('visible');
    }

    // Закрыть карточку при клике вне маркера (для мобильных)
    document.addEventListener('click', (e) => {
      if (!e.target.classList.contains('marker') && !e.target.classList.contains('marker-label')) {
        hideCard();
      }
    });

    // Запуск
    loadMap();
  </script>
</body>
</html>
